function FeedbackList({ feedback }) {
  if (!feedback || feedback.length === 0) {
    return 'Loading....'
  }

  const displayList = feedback.map(item => {
    return <li key={item.id}>Text: {item.text} Rating: {item.rating}</li>
  });

  return (
    <div>
      <ul>
        {displayList}
      </ul>
    </div>
  )
}

export default FeedbackList
